function readData(jsonData)
{
  var ret;
  for(let data in jsonData)
  {
    document.write(typeof(jsonData[data]));
    if(typeof(jsonData[data])=="object")
      ret+=readData(jsonData[data]);
    else
      ret+=jsonData[data];
    document.write(data+": "+ret);
  }
  return ret;
}
export default readData;
